import { FormLabel, TextField } from '@mui/material'
import React from 'react'

const Addbook = () => {
  return (
    <form style={{ marginTop:'4%'}}>
      <FormLabel>Name</FormLabel>
      <TextField margin='normal' fullWidth/>
    </form>
  )
}

export default Addbook
